import { BehaviorSubject } from "rxjs";

export default class Env {
  private static _audioVolume: BehaviorSubject<number> = new BehaviorSubject(
    0.05
  );
  private static _caseOpeningTime: BehaviorSubject<
    number
  > = new BehaviorSubject(8000);
  public static get audioVolume$() {
    return this._audioVolume.asObservable();
  }
  public static get caseOpeningTime$() {
    return this._caseOpeningTime.asObservable();
  }
}
